#include <unordered_map>
#include <vector>

/* Child and page sizes. */
typedef int child_s;
typedef int page_s;

/* Int as pointers. */
typedef int char_p;
typedef int child_p;
typedef int page_p;

/* A node of the Radix tree. */
struct Node {
    char_p chars;
    child_p children;
    page_p pages;
    /* The number of children. */
    child_s child_count;
    /* The number of pages. Is zero when this node is not an end. */
    page_s page_count;
};

/* Struct storing the data associated with a page. */
struct Page {
    short page_index;
    short count;
};

